import React, {useContext} from 'react';
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import FormControl from "@material-ui/core/FormControl";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Checkbox from "@material-ui/core/Checkbox";
import Input from "@material-ui/core/Input";
import InputLabel from "@material-ui/core/InputLabel";
import LockOutlinedIcon from "@material-ui/icons/LockOutlined";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import MenuItem from "@material-ui/core/MenuItem";
import Select from "@material-ui/core/Select"
import withStyles from "@material-ui/core/styles/withStyles";
import styles from '../styles/FormStyles';
import {DispatchContext} from "../contexts/FormContext";
import {LanguageContext} from "../contexts/LanguageContext";
import useInputState from '../hooks/useInputState'
const words = {
    english: {
        email: "email",
        signIn: "sign in",
        password: "password",
        remember: "remember me"
    },
    french: {
        email: "adresse electronique",
        signIn: "se conntetor",
        password: "mot de passe",
        remember: "souviens"

    },
    spanish: {
        email: "correo electronico",
        signIn: "registrarse",
        password: "contrasena",
        remember: "recuerdame"

    }
};
function Index(props) {
    const {classes} = props;
    const [value, handleChange, reset] = useInputState("");

    return (
        <main className={classes.main}>
            <Paper className={classes.paper}>
                <Avatar className={classes.avatarClass}>
                    <LockOutlinedIcon/>
                </Avatar>
                <Typography variant='h5'>Date of Birth (MM/DD/YYYY)</Typography>
                <form className={classes.form}>
                    <FormControl margin='normal' required fullWidth>
                        <InputLabel htmlFor='dob'>Date of Birth</InputLabel>
                        <Input id='dob' name='dob' autoFocus/>
                    </FormControl>
                    <FormControl margin='normal' required fullWidth>
                        <InputLabel htmlFor='password'>Password</InputLabel>
                        <Input id='password' name='password' autoFocus/>
                    </FormControl>
                    <Button variant='contained' type='submit' hafWidth color='primary' className={classes.submitClass}>Male</Button>
                </form>
            </Paper>
        </main>
    )
}
export default withStyles(styles)(Index)


